import ReactDOM from "react-dom";

ReactDOM.render(
<>
<ol>
    <li>Danish</li>
    <li>youtuber</li>
    <li> {youtuber} </li>
    <li> {Paragraph()} </li>
</ol>
</>,
document.getElementById("root")
);
